
UPDATE pmstask SET task_avatar=CONCAT('TASK_AVATAR_', task_id), task_desc=CONCAT('TASK_DESC_', task_id);
UPDATE pmsproject SET proj_default_task_id=proj_id*10, proj_avatar=CONCAT('PROJ_AVATAR_', proj_id), proj_desc=CONCAT('PROJ_DESC_', proj_id);
UPDATE pmscompany SET company_avatar=CONCAT('COMPANY_AVATAR_', company_id), company_desc=CONCAT('COMPANY_DESC_', company_id);
UPDATE pmscomment SET comment_desc=CONCAT('COMMENT_DESC_', comment_id), comment_filepath=CONCAT('COMMENT_FILEPATH_', comment_id);